import os
from tkinter.filedialog import askdirectory
import pygame
from  mutagen.mp3 import MP3
from tkinter import *
import time
import threading
from tkinter.ttk import *

root = Tk()
root.title("Beats")
root.iconbitmap(r'favicon.ico')
root.geometry('1000x1000')
root['bg']='#00629b'

listofsongs=[]
songname=[]

v = StringVar()
songlabel = Label(root,textvariable=v,width=50)

play_status=FALSE
index = 0
unmute_img=PhotoImage(data="")
mute_img=PhotoImage(data='')
play_img=PhotoImage(data='')
pause_img=PhotoImage(data='')
next_img=PhotoImage(data='')
previous_img=PhotoImage(data='')                    



def directorychooser():

    directory = askdirectory()
    os.chdir(directory)
    for files in os.listdir(directory):
        if files.endswith(".mp3"):

            listofsongs.append(files)


    pygame.mixer.init()
    pygame.mixer.music.load(listofsongs[index])
    pygame.mixer.music.play(loops=-1)
directorychooser()    

def stopsong(event):
    global play_status
    global play_status_string
    if  play_status:
          play_status=FALSE
          pygame.mixer.music.unpause()
          v.set("")
          stopbutton['image']=play_img
    else:
         play_status=TRUE
         pygame.mixer.music.pause()
         v.set("")
         stopbutton['image']=pause_img
def show_details():
    filelabel['text']="Playing" + ' - '+listofsongs[index]
    if listofsongs[index].endswith('.mp3'):
        audio=MP3(listofsongs[index])
        total_length=audio.info.length
        mins,secs=divmod(total_length ,60)
        mins=round(mins)
        secs=round(secs)
        timeformat = '{:02d}:{:02d}'.format(mins,secs)
        lengthlabel['text']="Total Length" + ' - '+timeformat
       
        t1=threading.Thread(target=start_count,args=(total_length,))
        t1.start()
    else:
        print("MP3 file not found")


    
    
def start_count(t):
    global play_status
    x=0
    while x<=t and pygame.mixer.music.get_busy():
        if play_status:
            continue
        else:        
         mins,secs=divmod(x,60)
         mins=round(mins)
         secs=round(secs)
         timeformat = '{:02d}:{:02d}'.format(mins,secs)
         currenttimelabel['text']="Current Time" + ' - '+timeformat
         time.sleep(1)
         x+=1         
    

def updatelabel():
    global index
    global songname
    v.set(listofsongs[index])
    return songname
    show_details()

def set_vol(_=None):
    pygame.mixer.music.set_volume(scale.get())
   
    
muted=FALSE
def mute_music():
    global muted
    if muted:
        pygame.mixer.music.set_volume(0.7)
        volumebutton.configure(image=unmute_img)
        scale.set(70)
        muted=FALSE
    else:
        pygame.mixer.music.set_volume(0)
        volumebutton.configure(image=mute_img)
        scale.set(0)
        muted=TRUE
def nextsong(event):
    global index
    index += 1
    pygame.mixer.music.load(listofsongs[index])
    pygame.mixer.music.play(loops=-1)
    show_details()
    stopbutton['image']=play_img

def prevsong(event):
    global index
    index -= 1
    pygame.mixer.music.load(listofsongs[index])
    pygame.mixer.music.play(loops=-1)
    show_details()
    stopbutton['image']=play_img
    
    
label = Label(root,text='Music Player')
label.pack()
listbox = Listbox(root)
listbox.pack()

listofsongs.reverse()
for items in listofsongs:
    listbox.insert(0,items)

listofsongs.reverse()    

btnframe = Frame(root)
btnframe.pack()

lengthlabel=Label(root,text='Total length - 00.00')
lengthlabel.pack(pady=10)

currenttimelabel=Label(root,text='Current Time : 00.00',relief=GROOVE)
currenttimelabel.pack()

scale= Scale(root,from_=0,to=1,orient=HORIZONTAL,command=set_vol)
scale.set(0.65)
pygame.mixer.music.set_volume(0.65)
scale.pack()

volumebutton=Button(btnframe,image=unmute_img,command=mute_music)
volumebutton.pack()

previousbutton = Button(btnframe,image=previous_img)
previousbutton.pack(side=LEFT, padx=10,pady=15)

stopbutton = Button(btnframe,image=play_img)
stopbutton.pack(side=LEFT, padx=10,pady=15)

nextbutton = Button(btnframe,image=next_img)
nextbutton.pack(side=LEFT, padx=10,pady=15)

previousbutton.bind("<Button-1>",prevsong)
stopbutton.bind("<Button-1>",stopsong)
nextbutton.bind("<Button-1>",nextsong)

filelabel=Label(root,text='Lets make some noise!')
filelabel.pack(pady=10)

show_details()
songlabel.pack()



root.mainloop()
